function isNumber(c){
	if (c >= '0' && c <= '9') {
    return true;
} else {
    return false;
}
}

document.getElementById('inputBar').addEventListener("keydown", function(){setTimeout(search,time)});

function search(){
	var results = 0;
	// Sets up variables
	let input = document.getElementById("inputBar").value
	var possiblePeople = []
	
	
	// Splits up input
	arr = input.split(" ");
	
	// Pretty obvious
	input = ""


	// For every word in the list make it uppcase and add it back to input with a space
	for (var i = 0; i < arr.length; i++) {
    arr[i] = arr[i].charAt(0).toUpperCase() + arr[i].slice(1);
    input = input + arr[i] +" "
	}

	// Removes final space
	input = input.slice(0, -1);
	


	// If input start with a number
	if(isNumber(input.charAt(0))){

		for (var key in Dict2022){
			var item = Dict2022[key]
			if(item.includes(input)){
				possiblePeople.push(key);
				results += 1;
		}

	}


	}



	else if(input == "Staff"){
		for (var key in Dict2022){
			var item = Dict2022[key]
			if(isNumber(item.charAt(0)) == false){
				possiblePeople.push(key);
				results += 1;
		}
		
	}
}



	else if(input == "Students" || input == "Student"){
		for (var key in Dict2022){
			var item = Dict2022[key]
			if(isNumber(item.charAt(0))){
				possiblePeople.push(key);
				results += 1;
		}
		
	}
}	
	// searches via email
	else if(input.charAt(0) == "@"){
		input = input.slice(1)
		for (var key in Dict2022){
			var item = Dict2022[key]

			if(item.includes(input)){
				possiblePeople.push(key);
				results += 1;
			}
		
		
	}
}


	else{

	// finds people based on a name based input
	for (var key in Dict2022){
		if(key.includes(input)){
		possiblePeople.push(key);
		results += 1;
		}
		
	}

}
	// Clears table
	while (table.firstChild){
	table.removeChild(table.firstChild);
	}
	
	// Reverses the list to make it alphabetical order
	possiblePeople.reverse()


	// Add everyone to table
	for(var person in possiblePeople){
		
		var row = table.insertRow(0);
    	var cell1 = row.insertCell(0);
    	var cell2 = row.insertCell(1);
    	cell1.innerHTML = possiblePeople[person];
    	cell2.innerHTML = Dict2022[possiblePeople[person]];
	}

	// Adds Name and Email Columns
	var row = table.insertRow(0);
	var cell1 = row.insertCell(0);
	var cell2 = row.insertCell(1);
	cell1.innerHTML = "Name";
	cell2.innerHTML = "Email";

const result  = results

document.getElementById("searchResults").textContent = `Search Results: ${results}`
}


